CREATE TABLE months
(
  id serial NOT NULL,
  year smallint,
  month smallint,
  name character varying(20),
  name_year character varying(30),
  start_c date,
  end_c date,
  days smallint,
  CONSTRAINT pk_months PRIMARY KEY (id )
)
WITH (
  OIDS=FALSE
);
ALTER TABLE months
  OWNER TO mateus;




